import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import axios from "axios";
import "./CreateTeamProject.css";

function CreateTeamProject() {
  const { state } = useLocation();
  const { courseId, courseName } = state || {};

  const [teams, setTeams] = useState([]);
  const [selectedTeamId, setSelectedTeamId] = useState("");
  const [projectName, setProjectName] = useState("");
  const [deadline, setDeadline] = useState(""); // ÏûêÎèô ÏÑ§Ï†ïÌï† ÎßàÍ∞êÏùº
  const [message, setMessage] = useState("");
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchTeams = async () => {
      try {
        const response = await axios.get(`http://localhost:8090/api/team?courseId=${courseId}`, {
          headers: { Authorization: `Bearer ${token}` },
        });
        const teamsData = Array.isArray(response.data) ? response.data : [];
        setTeams(teamsData);
      } catch (error) {
        console.error("ÌåÄ Î™©Î°ù Î∂àÎü¨Ïò§Í∏∞ Ïã§Ìå®:", error);
      }
    };

    if (courseId) {
      fetchTeams();
    }
  }, [courseId, token]);

  // ÌåÄ ÏÑ†ÌÉù Ïãú Ìï¥Îãπ ÌåÄÏùò ÎßàÍ∞êÏùº ÏûêÎèô ÏûÖÎ†•
  const handleTeamChange = (e) => {
    const selectedId = e.target.value;
    setSelectedTeamId(selectedId);

    // ÏÑ†ÌÉùÌïú ÌåÄÏùò deadlineÏùÑ Ï∞æÏïÑ ÏûêÎèô ÏûÖÎ†•
    const selectedTeam = teams.find((team) => team.id.toString() === selectedId);
    if (selectedTeam) {
      setDeadline(selectedTeam.deadline || ""); // ÎßàÍ∞êÏùºÏù¥ ÏóÜÏúºÎ©¥ Îπà Í∞í
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!selectedTeamId || !projectName || !deadline) {
      setMessage("Î™®Îì† ÌïÑÎìúÎ•º ÏûÖÎ†•ÌïòÏÑ∏Ïöî.");
      return;
    }

    try {
      const payload = {
        teamId: selectedTeamId,
        projectName,
        deadline, // ÏÑ†ÌÉùÌïú ÌåÄÏùò ÎßàÍ∞êÏùºÏùÑ Í∑∏ÎåÄÎ°ú ÏÇ¨Ïö©
        courseId,
      };

      const response = await axios.post("http://localhost:8090/api/team-projects", payload, {
        headers: { Authorization: `Bearer ${token}` },
      });

      setMessage("‚úÖ ÌåÄ ÌîÑÎ°úÏ†ùÌä∏Í∞Ä ÏÑ±Í≥µÏ†ÅÏúºÎ°ú ÏÉùÏÑ±ÎêòÏóàÏäµÎãàÎã§!");
      setSelectedTeamId("");
      setProjectName("");
      setDeadline("");
    } catch (error) {
      console.error("‚ùå ÌåÄ ÌîÑÎ°úÏ†ùÌä∏ ÏÉùÏÑ± Ïã§Ìå®:", error);
      setMessage("üö® ÌåÄ ÌîÑÎ°úÏ†ùÌä∏ ÏÉùÏÑ± Ïã§Ìå®");
    }
  };

  return (
    <div>
      <h2>ÌåÄ ÌîÑÎ°úÏ†ùÌä∏ ÏÉùÏÑ± - Í∞ïÏùò: {courseName || "Í∞ïÏùò Ï†ïÎ≥¥ ÏóÜÏùå"}</h2>
      {message && <p>{message}</p>}
      <form onSubmit={handleSubmit}>
        <div>
          <label>ÌåÄ ÏÑ†ÌÉù: </label>
          <select value={selectedTeamId} onChange={handleTeamChange} required>
            <option value="">ÌåÄÏùÑ ÏÑ†ÌÉùÌïòÏÑ∏Ïöî</option>
            {teams.map((team) => (
              <option key={team.id} value={team.id}>
                {team.name}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label>ÌîÑÎ°úÏ†ùÌä∏ Ïù¥Î¶Ñ: </label>
          <input type="text" value={projectName} onChange={(e) => setProjectName(e.target.value)} required />
        </div>
        <div>
          <label>ÎßàÍ∞êÏùº: </label>
          <input type="datetime-local" value={deadline} readOnly /> {/* ÏûêÎèô ÏÑ§Ï†ïÎêú ÎßàÍ∞êÏùº, ÏàòÏ†ï Î∂àÍ∞Ä */}
        </div>
        <button type="submit">ÏÉùÏÑ±ÌïòÍ∏∞</button>
      </form>
    </div>
  );
}

export default CreateTeamProject;
